export const esNombre = (value) =>{
    return /^[a-zA-ZÀ-ÿ\s]{1,40}$/.test(value);
}
export const esPrecio = (value) =>{
    return /^[\d{1,4}]+.[\d{1,2}]+$/.test(value);
}
